import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import ContactState from './context/contact/ContactState';
import AuthState from './context/auth/AuthState';

ReactDOM.render(
  <React.StrictMode>
    <ContactState>
      <AuthState></AuthState>
      <App />
    </ContactState>
  </React.StrictMode>,
  document.getElementById('root')
);
